    false,nt"url": null,nt"notes": "This annual narrative report for Aleutian
    Islands (including Simeonof NWR, Bogoslof NWR, and Semidi NWR) and Izembek NWRs
    outlines Refuge accomplishments during the 1970 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, and diseases- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    grazing, fur harvesting, and commercial fishing. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, hunting, violations, and safety.",nt"license_title":
